import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import { MDBInput, MDBNavbar, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBDropdown, MDBDropdownToggle, MDBDropdownMenu, MDBDropdownItem, MDBIcon, MDBSideNavItem, MDBSideNavCat, MDBSideNavNav, MDBSideNav, MDBContainer } from "mdbreact";
import logo from './Lib/logo.jpg';
import classes from './index.module.css'
export class HomePage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            toggleStateA: false
        };
    }

    handleToggleClickA = () => {
        this.setState({
            toggleStateA: !this.state.toggleStateA
        });
    };

    render() {
        const mainStyle = {
            paddingTop: "5rem"
        };

        const specialCaseNavbarStyles = {
            WebkitBoxOrient: "horizontal",
            flexDirection: "row"
        };

        return (
            <Router>
                <div className="light-blue-skin">
                    <MDBSideNav
                        triggerOpening={this.state.toggleStateA}
                        bg="https://mdbootstrap.com/img/Photos/Others/sidenav4.jpg"
                        mask="strong"
                        hidden
                    >

                        <div className={`${classes.Papyrus} py-3`}>MyEdMaster</div>

                        {/*<li>*/}
                            {/*<ul className="social">*/}
                                {/*<li>*/}
                                    {/*<a href="#!">*/}
                                        {/*<MDBIcon fab icon="facebook-f" />*/}
                                    {/*</a>*/}
                                {/*</li>*/}
                                {/*<li>*/}
                                    {/*<a href="#!">*/}
                                        {/*<MDBIcon fab icon="pinterest" />*/}
                                    {/*</a>*/}
                                {/*</li>*/}
                                {/*<li>*/}
                                    {/*<a href="#!">*/}
                                        {/*<MDBIcon fab icon="google-plus-g" />*/}
                                    {/*</a>*/}
                                {/*</li>*/}
                                {/*<li>*/}
                                    {/*<a href="#!">*/}
                                        {/*<MDBIcon fab icon="twitter" />*/}
                                    {/*</a>*/}
                                {/*</li>*/}
                            {/*</ul>*/}
                        {/*</li>*/}
                        <MDBInput
                            type="text"
                            hint="Search"
                            style={{
                                color: "#fffff",
                                padding: "0 10px 8px 30px",
                                boxSizing: "border-box"
                            }}
                        />
                        <MDBSideNavNav>
                            <MDBSideNavCat
                                name="Little Red Riding Hood"
                                id="submit-blog-cat"
                                icon="chevron-right"
                            >
                                <MDBSideNavItem>Ask Question</MDBSideNavItem>
                                {/*<MDBSideNavItem>Registration form</MDBSideNavItem>*/}
                            </MDBSideNavCat>
                            <MDBSideNavCat
                                name="Complex Numbers"
                                id="submit-blog-cat"
                                icon="chevron-right"
                            >
                                <MDBSideNavItem>Start</MDBSideNavItem>
                                {/*<MDBSideNavItem>Registration form</MDBSideNavItem>*/}
                            </MDBSideNavCat>

                            <MDBSideNavCat
                                name="Contact me"
                                id="contact-me-cat"
                                icon="envelope"
                            >
                                <MDBSideNavItem>FAQ</MDBSideNavItem>
                                <MDBSideNavItem>Write a message</MDBSideNavItem>
                            </MDBSideNavCat>
                            {/*<MDBSideNavCat*/}
                                {/*iconRegular*/}
                                {/*name="Instruction"*/}
                                {/*id="instruction-cat"*/}
                                {/*icon="hand-pointer"*/}
                            {/*>*/}
                                {/*<MDBSideNavItem>For bloggers</MDBSideNavItem>*/}
                                {/*<MDBSideNavItem>For authors</MDBSideNavItem>*/}
                            {/*</MDBSideNavCat>*/}
                            {/*<MDBSideNavCat name="About" id="about-cat" icon="eye">*/}
                                {/*<MDBSideNavItem>Instruction</MDBSideNavItem>*/}
                                {/*<MDBSideNavItem>Monthly meetings</MDBSideNavItem>*/}
                            {/*</MDBSideNavCat>*/}
                        </MDBSideNavNav>
                    </MDBSideNav>
                    <MDBNavbar double expand="lg" fixed="top" scrolling>
                        <MDBNavbarNav left>
                            <MDBNavItem>
                                <div
                                    onClick={this.handleToggleClickA}
                                    key="sideNavToggleA"
                                    style={{
                                        lineHeight: "35px",
                                        marginRight: "1em",
                                        verticalAlign: "middle"
                                    }}
                                >
                                    <MDBIcon icon="bars" color="white" size="2x" />
                                </div>
                            </MDBNavItem>
                            <MDBNavItem
                                className="d-none d-md-inline"
                                style={{
                                    fontFfamily: 'Arial',
                                    fontSize: '25px',
                                    fontStyle: 'normal',
                                    color:'white',
                                    fontWeight: '500',
                                    }}>
                                MyEdMaster
                            </MDBNavItem>
                        </MDBNavbarNav>
                        <MDBNavbarNav right style={specialCaseNavbarStyles}>
                            <MDBNavItem active>
                                <div>
                                    <MDBIcon icon="envelope" className="d-inline-inline" />{" "}
                                    <div className="d-none d-md-inline">Contact</div>
                                </div>
                            </MDBNavItem>
                            <MDBNavItem>
                                <div>
                                    <MDBIcon far icon="comments" className="d-inline-inline" />{" "}
                                    <div className="d-none d-md-inline">Support</div>
                                </div>
                            </MDBNavItem>
                            <MDBNavItem>
                                <div>
                                    <MDBIcon icon="user" className="d-inline-inline" />{" "}
                                    <div className="d-none d-md-inline">Account</div>
                                </div>
                            </MDBNavItem>
                        </MDBNavbarNav>
                    </MDBNavbar>
                    <main style={mainStyle}>
                        <MDBContainer fluid style={{ height: 2000 }} className="mt-5">
                            <h2>Advanced Double Navigation with hidden SideNav & fixed Navbar:</h2>
                            <br />
                            <h5>1. Hidden side menu. Click "hamburger" icon in the top left corner to open it.</h5>
                            <h5>2. Fixed navbar. It will always stay visible on the top, even when you scroll down.</h5>
                        </MDBContainer>
                    </main>
                </div>
            </Router>
        );
    }
}
